import React, { Component } from 'react'

import { SearchOutlined } from '@ant-design/icons'
export default class Buttons extends Component {
    render() {
        return (
            <div>
                <Card title="基础按钮">
                    <Button type="primary" icon={<SearchOutlined />}>primary</Button>
                </Card>    
            </div>
        )
    }
}
